import React from 'react';

const GptSummary = () => {
  return (
    <div className="gpt-summary">
      <h3>GPT 요약</h3>
      <div className="summary-content">
        {/* GPT 요약 내용이 여기에 들어갑니다 */}
        <p>여기에 GPT가 생성한 상담 요약 내용이 표시됩니다.</p>
      </div>
    </div>
  );
};

export default GptSummary;
